script: |
  super -f text -I q11450.spq | sort > q11450.out

inputs:
  - name: q11450.spq
    data: |
      SELECT DISTINCT 15 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q11450.out
    data: |
      15
